(1612, '0AFCE98C-6B63-4DB0-A0D5-86446C04B127', 'TMinusDelete', 'This importer will delete files after a specified number of days.', '', 'Import', 'None', 'Commercial', 'Beta', '2009-05-11 16:06:29', '1.0.0.0', 'ccrocker', '', 'UL By:zag2me', '', '', 'plugins/0AFCE98C-6B63-4DB0-A0D5-86446C04B127/1.0.0.0/beta/TMinusDelete_1.0.0.0_Beta.mopp', '6137', '', '', '', 1000000000000000000, 0, 'This importer will delete a file after a specified number of days.  This Importer will create tag named "ArchivePreference" .  This tag should be populated as either "Temporary" or "Permanent"  either manually or via another importer.  Temporary files are subject to deletion after a user selected number of days.  Permanent files are not deleted.  The tag DaysUntilDeletion will count down days each time the importer is run.  When this amount is less than 1, the related file and library item will be deleted.  \n\nCan also be set to delete "Temporary" files after watched.', 'TMinusDelete', '', '', '', '', '0', '1', 29, 268, 0, 0, 0, 0, '6689c69ead3b9c69e21e71f560da96ad', 'FALSE'),
