(3062, '1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4', 'Default Icon Theme', 'Icons for Meedios Default Theme', '', 'Icon', 'None', '', 'Alpha', '2011-02-20 14:54:23', '1.0.3', 'Harald D. Wagner and Skypichat', '', 'skypichat', '2007-2011, Harald D. Wagner', '', 'plugins/1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4/1.0.3/alpha/Default_Icon_Theme_1.0.3_Alpha.mopp', '5315845', '', '', 'DefaultTheme.txt', 1000003000000000000, 0, 'This is the default icon theme\n\n\nIt''s a standalone icon theme. It''s also the fallback theme for other (incomplete) icon themes.\n\n\n\nAdditionally it provides icons for non-themed applications like ConfigurationEditor: \n\n"user" is used as default user icon in ConfigurationEditor.exe\n"default" is used as last fallback possibility by MeediOS.exe if a given file or resource does not exist.\n\n\n\nThe mapping of resource names and file names is done on a per-UI-type basis.\nResource names are UI independant, file names may be individual to the UI type. \nResource names are theme independant, file names may be individual to the current theme.\nResourceDictionary.WPFUI.xaml defines the mapping for WPFUI, ResourceDictionary.WinFormUI.XML defines the mapping for WinFormUI.\n\n\n\nIcon resource names should have the following format:\n\nPlugin name "radio", "music", ..., if applicable.\nPlugin type "-module", "-general", ..., if applicable.\nTask "-up", "-record", "-show", "-modify", "-rating", "-rotate", ..., if applicable.\nState "-sel","-unsel", "-active", "-inactive", "-down"/"-pressed", "-tv14", "-left", ... , if applicable.\nPlace to find "-background", "-frame", "-indicator", ..., if applicable.\nSuffix "-icon".\n\nIcon file names should have the same format plus the adequate file extension.', 'default', '', '', '', '', '0', '1', 2, 327, 0, 0, 0, 0, '411c3aac82d49f96e2491ef083d84bb0', 'FALSE'),
(1630, '9E89FF51-30EC-4AC5-8304-072BE462F93D', 'meeWebRadios', 'Download Banners, logos... and add stations in your library', '', 'Import', 'None', 'Freeware', 'Stable', '2009-05-18 09:01:24', '1.1.4', 'Flop', 'Flop@meediofr.org', 'flclsd', 'Copyright Â© 2009 - MeedioFR', '', 'plugins/9E89FF51-30EC-4AC5-8304-072BE462F93D/1.1.4/stable/meeWebRadios_1.1.4_Stable.mopp', '5845', '', '', '', 1001004000000000000, 0, '', 'meeWebRadios', 'www.meediofr.org', '', '', '', '0', '1', 305, 612, 0, 0, 0, 0, 'c229d45dce06d8a9d94f606330f4ff2c', 'FALSE'),
(1631, '09575335-9CEF-49FC-80E9-8A1260EEFED8', 'Hide Taskbar', 'Hides Windows Taskbar', '', 'General', 'None', '', 'Alpha', '2009-05-24 00:13:24', '1.0.0.0', 'ccrocker', '', 'ccrocker', '', '', 'plugins/09575335-9CEF-49FC-80E9-8A1260EEFED8/1.0.0.0/alpha/Hide_Taskbar_1.0.0.0_Alpha.mopp', '6217', '', '', '', 1000000000000000000, 0, 'C# source code is included if anyone needs to or wants to make improvements.', 'Hide Taskbar', '', '', '', '', '0', '1', 6630, 12023, 0, 0, 0, 0, 'd90704056568e54b5cfd4b0080079ed4', 'FALSE'),
(2318, 'C9E487C3-8A8D-4194-894F-404D22564773', 'TriggerMee', 'Monitor folders for new files, and instantly trigger an importer (or anything)', '', 'General', 'None', '', 'Stable', '2010-03-10 04:21:11', '0.61', 'hisdudity, Original code from binary64', '', 'hisdudity', '2009', '', 'plugins/C9E487C3-8A8D-4194-894F-404D22564773/0.61/stable/TriggerMee_0.61_Stable.mopp', '100411', '', '', 'Readme.txt', 61000000000000000, 0, 'TriggerMee\n\nSend messages when a monitored folder is changed in real-time. A message could trigger an importer to run.\n\n\nOptions help:\n\nFolder to watch = mandatory. a single folder to listen to for changes. subdirectories included. can be unc.\nFile masks = mandatory. file mask(s) to listen for. seperate with a space. example: "*.avi .mpg mpeg" without quotes will listen for avi''s, mpg''s and mpeg''s. just enter "*" without quotes for all files.\nMessage to send = mandatory. a meedio message to send when new file found. example: "meedio.message-subject|tag1=value1|tag2=value2" without quotes.\nOnly trigger when file becomes unlocked = if true, only executes the message when file first becomes unlocked. if false, the message is executed without delay. default of checked is recommended.\nTrigger on load = default=false. if true, when the watcher first connects to a folder, the message will be executed.\nTrigger on reconnect = default=false. if true, when the watcher is reconnected to a folder after having been disconnected, the message will be executed.\nUse Smart Hash feature = default=true. if true, a hash table is maintained reflecting the directory monitored.. after a reconnect or connect, if the table has changed, the message will be executed.\n\nReconnect to disconnected paths (global option) = [integer] Used for when plugin is watching a UNC share, and server connection is lost. How many seconds should this plugin attempt reconnection to all disconnected watchers? Specify -1 or 0 to turn this feature off (not recommended). Blank this entry to use the internal default.\nThrottle trigger (global option) = [integer] Don''t re-trigger the same trigger if trigger triggered in the last x seconds. Blank this entry to use defaults. Any throttled triggers currently get lost/ignored.', 'TriggerMee', 'http://www.meedios.com/forum/viewtopic.php?t=', '', '', '', '0', '1', 15, 26336, 0, 0, 0, 0, 'b9005c4e6076fb7863293086bc6d3e8f', 'FALSE'),
(4039, 'D7D94DB7-7FAD-4F00-880C-69C45D989126', 'TVShowsDataImporter', 'Add details and images in your TVShows Library', '', 'Import', 'None', 'Donationware', 'Beta', '2012-05-15 13:34:20', '4.012', 'Dakkar', '', 'Dakkar', 'MeediOS', '', 'plugins/D7D94DB7-7FAD-4F00-880C-69C45D989126/4.012/beta/TVShowsDataImporter_4.012_Beta.mopp', '645326', '', '', '', 4012000000000000000, 0, '', 'TVShowsDataImporter', '', 'http://www.meedios.com/forum/viewtopic.php?f=14&t=5774', '', '', '0', '1', 7, 3537, 0, 0, 0, 0, 'c0ad383631eee2f56100933fffa5e70f', 'FALSE'),
