(1700, '818B3077-0449-4B1F-BA4C-BFB5882C760D', 'USB-UIRT', 'Use the USB-UIRT with Meedio.  Supports receive only at this time.', '', 'Input', 'None', 'Commercial', 'Alpha', '2009-07-26 16:42:25', '4.0', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/818B3077-0449-4B1F-BA4C-BFB5882C760D/4.0/alpha/USB-UIRT_4.0_Alpha.mopp', '40276', '', '', '', 4000000000000000000, 0, 'Set the delay and buffer, and then use the Learn button (in Configuration...Input) to map IR codes to Meedio commands.\n\n***IMPORTANT***\n\nMake sure to add USB-UIRT to the Command Input "Input Sources" list of the UI Plugin (i.e. WPFUI).  If you don''t add it, it won''t work.', 'USB-UIRT', 'http://www.meedios.com/forum/viewtopic.php?t=4888', '', '', '', '0', '1', 10499, 13531, 0, 0, 0, 0, 'f46a940457154278dffd3cdf03d36e4b', 'FALSE'),
