(2755, '7A47417D-070D-474B-BE34-6D11DE6B319F', 'FileRenamer', 'Rename and move files and directories based on library tags', '', 'Import', 'None', '', 'Stable', '2010-07-26 02:05:38', '1.0.1.8', 'ccrocker', '', 'ccrocker', '', '', 'plugins/7A47417D-070D-474B-BE34-6D11DE6B319F/1.0.1.8/stable/FileRenamer_1.0.1.8_Stable.mopp', '45536', '', '', '', 1000001008000000000, 0, 'WARNING. Before you just run this with blind trust on your library, I recommend testing with a few file copies in a test library. I have run it on my complete library and everything was renamed without error, but I can''t test every scenario...  If you don''t test and your files go POOF, consider your warned...', 'FileRenamer', '', '', '', '', '0', '1', 4, 2999, 0, 0, 0, 0, '33299fd2c630f10461a19c6c267fea81', 'FALSE'),
(1704, '5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC', 'ControlMee', 'ControlMee allows you to use your Meedio remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.  Supports a keyboard hook and numeric keyboard.', '', 'General', 'None', 'Commercial', 'Alpha', '2009-07-27 09:58:04', '2.4.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC/2.4.1/alpha/ControlMee_2.4.1_Alpha.mopp', '204549', '', '', 'readme.html', 2004001000000000000, 0, 'ControlMee allows you to use your Meedio remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.\n\nDirections at: http://controlmee.hargraveusa.com/\n\n*New for v2.1: Added support for a numeric keyboard.  Use the number keys (2...9) to type letters like on your cell phone.  The max delay setting determines how long the plugin will wait between key presses before resetting the key to its initial numeric value.\n\n***IMPORTANT***\n\nControlMee must be moved above "InputMapper" in the Fulltime Plug-ins list.', 'ControlMee', '', '', '', '', '0', '1', 146, 3394, 0, 0, 0, 0, '73a67cc6295c116aea6ec4f0cb9e56d7', 'FALSE'),
