(1749, '3AE69DCF-B3C6-4DD3-85A8-2744A3B50452', 'MediaFairy for MeediOS', 'An automated media importer and updater which aims to provide a complete solution for Meedio users to easily import and acquire meta-info for their media collections.', '', 'Import', 'None', 'Donationware', 'Beta', '2009-08-25 15:08:57', '0.4.9', 'Skamagkis Stavros', 'stavros_sk@ownmail.net', 'enthalpient', '2008-2009 Skamagkis Stavros', '', 'plugins/3AE69DCF-B3C6-4DD3-85A8-2744A3B50452/0.4.9/beta/MediaFairy_for_MeediOS_0.4.9_Beta.mopp', '5460492', '', '', '', 4009000000000000, 0, 'For release notes, usage instructions, bug reports or suggestions, please refer to the plugin''s thread on MeediOS forum:\n\nhttp://www.meedios.com/forum/viewtopic.php?t=3912', 'MediaFairy', 'http://www.meedios.com/maid', '', '0.1', '10', '0', '1', 301, 1995, 0, 0, 0, 0, '97d2167bf8578e8cd66f06f5ff929992', 'FALSE'),
