(1754, 'C90F61B1-C8DD-49B0-8742-0FC7EA78FE95', 'NexTagGenre', 'Attempt to retrieve Artist Genre on the net', '', 'Import', 'None', '', 'Alpha', '2009-08-29 05:36:49', '1.0.1.1', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', '', '', 'plugins/C90F61B1-C8DD-49B0-8742-0FC7EA78FE95/1.0.1.1/alpha/NexTagGenre_1.0.1.1_Alpha.mopp', '23319', '', '', '', 1000001001000000000, 1, 'NexTagGenre is a import plugin for meedios.\n\n*** Plz make a backup before processing. So you can restore if you don''t agree with  tags found by this plugin. ***\n\n\nMost of the time, audiofile genre tag is badly filled or even leaved blank. \nSo it makes the Genre filter useless.\n\nSo NexTagGenre attempts to retrieve on the net the Genre of songs. It retrieve the tag from LastFm artist page.\n\n\nNexTagGenre retrieve the Genre of the artist, and apply this genre to all the songs of this artist (Faster), \nbecause songs of an Artist are, most of the time, of the same genre. \n\nSee my audio import plugin : NexAudioImport to import Audio without overwritten already processed Tag Genres.\n\n \n\nDetail of the options :\n\nOptions:\n--------\n\n- Process ALL Songs : Processed all songs even songs already processed. Days between recheck is not used with this option\n\n- Don''t process already tagged Genre : Songs processed by NexTagGenre have a GenreProcessed tag filled with "---processed---". \nSo you can bypass the already processed songs in the next import.\n\n- Keep genre of Artist already in database : If an Artist song has already been processed (GenreProcessed = "---processed---") , \nyou can reuse the same genre (and bio) for all the songs of this artist.\n\n- Use Multi-Genre : You can tag Meedio Genre tag with multi genres (genre are separated with a  pipe) . If not ticked, retrieve one genre only.\n\n- Days Between recheck : Number of days between attempts to check genre for non already processed Genre (GenreProcessed <> "---processed---")\n\n- Add actual genre to new found genre : If meedio tag genre contains genres, they will be add to new found genre.\n\n\n\nGenres List\n-----------\n\nList of authorized genres : List of authorized genres. You can add your own genres here. Only genres present in this list are used for tagging genre.', 'NexTagGenre', '', '', '1.0.1.1', '', '0', '1', 309, 309, 0, 0, 0, 0, '0b76d85525db011bdd76ba81c2c394ac', 'FALSE'),
