(1756, 'CB617265-D200-42C6-A953-64419B470D3A', 'Respond', 'Respond is an event driven plugin that offers functionality similar to a lite scripting language.  The plugin will listen for user-defined events (such as a video starting to play) and answer with user-defined responses.', '', 'General', 'None', 'Commercial', 'Beta', '2009-09-03 14:38:23', '0.2', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/CB617265-D200-42C6-A953-64419B470D3A/0.2/beta/Respond_0.2_Beta.mopp', '280074', '', '', '', 2000000000000000, 0, 'Respond is an event driven plugin that offers functionality similar to a lite scripting language.  The plugin will listen for user-defined events (such as a video starting to play) and answer with user-defined responses.\n\nIncludes two example scripts.  One is very useful for proper queue control with PlayMee.', 'Respond', '', '', '', '', '0', '1', 69, 8784, 0, 0, 0, 0, 'baea0af77658d41708e4b7544d888424', 'FALSE'),
