(1836, '37A076F2-94A3-4AB0-913F-B5B936181635', 'ItemTagCounter', 'ItemTagCounter provides some tools for counting and creating tags in your libraries.', '', 'Import', 'None', '', '', '2009-10-23 08:43:29', '0.2', 'hisdudity', '', 'hisdudity', 'hisdudity', '', 'plugins/37A076F2-94A3-4AB0-913F-B5B936181635/0.2//ItemTagCounter_0.2_.mopp', '48040', '', '', '', 2000000000000000, 0, 'ItemTagCounter comes with different tools to help usage and display of huge libraries.\n\n- custom tag creator : \nexample : release_name|{artist} - {album} [{year} @ {label}] will create the tag {release_name} from other preexisting tags.\n\n- custom counter : \nexample : artist|album will count the number of different albums for each artist.\nit will creates some tags to use this count.\n\n- index counter : creates an index tag and counts sub-items  for a tag.\n\n- index 2 counter : creates a 2-letters index tag and counts sub-items  for a tag.', 'ItemTagCounter', '', '', '', '', '0', '1', 8, 2639, 0, 0, 0, 0, 'd157ca5bf20f4c52356190062a84ab75', 'FALSE'),
