(1876, '5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC', 'ControlMee', 'ControlMee allows you to use your MeediOS remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.  Supports a keyboard hook and numeric keyboard.', '', 'General', 'None', 'Commercial', 'Alpha', '2009-11-24 12:03:53', '2.4.2', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC/2.4.2/alpha/ControlMee_2.4.2_Alpha.mopp', '204538', '', '', 'readme.html', 2004002000000000000, 0, 'ControlMee allows you to use your MeediOS remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.\n\nDirections at: http://controlmee.hargraveusa.com/\n\n*New for v2.1: Added support for a numeric keyboard.  Use the number keys (2...9) to type letters like on your cell phone.  The max delay setting determines how long the plugin will wait between key presses before resetting the key to its initial numeric value.\n\n***IMPORTANT***\n\nControlMee must be moved above "InputMapper" in the Fulltime Plug-ins list.', 'ControlMee', '', '', '', '', '0', '1', 2107, 3394, 0, 0, 0, 0, '6b185ba4837e0f60feeb2e4ecd42c645', 'FALSE'),
