(1914, 'FA41FD9F-0CCD-4336-83FB-FD4A7AFF9ECD', 'ExcelImportExport', 'Exports a library section to an Excel file and imports an Excel file into a library section.', '', 'Import', 'None', '', 'Beta', '2009-12-18 14:26:24', '1.1', 'Harald D. Wagner', '', 'HdWagner', '(c) 2009 Harald D. Wagner', '', 'plugins/FA41FD9F-0CCD-4336-83FB-FD4A7AFF9ECD/1.1/beta/ExcelImportExport_1.1_Beta.mopp', '53053', '', '', '', 1001000000000000000, 0, 'This import plugin exports a library section to an Excel file and imports an Excel file into a library section. \n\nInstructions: \nAdd the import to a library section. Choose "import" or "export". Provide a file path. Click "Run selected import".\n\nHints:\nNote that the values of the "ID" column are used as primary key. Imported Excel rows with valid ID will override the the section item with this very ID. Excel rows without (valid) ID will create new section items.\n\nNote also that Excel supports up to 65536 rows, 255 columns, 32767 characters per cell. If your library sections exceeds this, some rows or columns might not be exported.', 'ExcelImportExport', '', 'http://www.meedios.com/OpenMAIDOS/detail.php?plugin_id=FA41FD9F-0CCD-4336-83FB-FD4A7AFF9ECD', '', '', '0', '1', 28, 455, 0, 0, 0, 0, '425ed2754f2a4bb64d57c4d9e1c29bea', 'FALSE'),
