(2173, '818B3077-0449-4B1F-BA4C-BFB5882C760D', 'USB-UIRT', 'Use the USB-UIRT with MeediOS.  Supports receive only at this time.', '', 'Input', 'None', 'Commercial', 'Beta', '2010-02-21 08:53:23', '4.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/818B3077-0449-4B1F-BA4C-BFB5882C760D/4.1/beta/USB-UIRT_4.1_Beta.mopp', '73308', '', '', '', 4001000000000000000, 0, 'Set the delay and buffer, and then use the Learn button (in Configuration...Input) to map IR codes to Meedio commands.\n\n***IMPORTANT***\n\nMake sure to add USB-UIRT to the Command Input "Input Sources" list of the UI Plugin (i.e. WPFUI).  If you don''t add it, it won''t work.', 'USB-UIRT', 'http://www.meedios.com/forum/viewtopic.php?t=4888', '', '', '', '0', '1', 456, 13531, 0, 0, 0, 0, '3e046215691b60ceebc496b90414f9e6', 'FALSE'),
(1920, '37A076F2-94A3-4AB0-913F-B5B936181635', 'ItemTagCounter', 'ItemTagCounter provides some tools for counting and creating tags in your libraries.', '', 'Import', 'None', '', '', '2009-12-20 15:12:25', '0.9', 'hisdudity', '', 'hisdudity', 'hisdudity', '', 'plugins/37A076F2-94A3-4AB0-913F-B5B936181635/0.9//ItemTagCounter_0.9_.mopp', '45363', '', '', '', 9000000000000000, 0, 'ItemTagCounter comes with different tools to help usage and display of huge libraries.\n\n      - custom tag creator :\n      example : "release_name|{artist} - {album} [{year} @ {label}]" will create the tag "{release_name}" from other preexisting tags.\n\n      - Custom Regex Tag :\n      format : NewTag|OldTag|Regex|Replacement\n      e.g : "realname|sortname|(.*) \\((.*)\\)|$1 $2" will transform "beatles (the)" to "the beatles"\n      \n      - custom counter :\n      example : artist|album will count the number of different albums for each artist.\n      it will creates some tags to use this count.\n\n      - index counter : creates an index tag and counts sub-items  for a tag.\n\n      - index 2 counter : creates a 2-letters index tag and counts sub-items  for a tag.', 'ItemTagCounter', 'http://www.meedios.com/forum/viewtopic.php?t=5061', '', '', '', '0', '1', 7, 2639, 0, 0, 0, 0, '50c204282db3dc2cb89788149368aee2', 'FALSE'),
