(3746, '04908AF7-33CF-41E4-B476-2E9F4737A3DC', '4TR Importer', 'Imports TV Recordings produced using For the Record', '', 'Import', 'None', '', 'Beta', '2012-02-03 12:53:16', '1.03', 'NeverMind', '', 'NeverMind', '', '', 'plugins/04908AF7-33CF-41E4-B476-2E9F4737A3DC/1.03/beta/4TR_Importer_1.03_Beta.mopp', '377857', '', '', '', 1003000000000000000, 1, 'This plugin will import the details of TV or Radio shows recorded using the For the Record system.\n\nSetup\n====\n\nSelect the types of recordings you wish to import (TV, Radio or Both)\n\nModify the TVShowsSettings as per screenshot of Advanced Settings.\nThis will ensure that Meedios will show the thumbnails created by For the Record if any subsequent importer cannot find an episode thumbnail.\n\nAdd the location(s) of your recordings as shown in the General Settings screenshot.', '4TRImporter', '', '', '', '', '0', '1', 96, 104, 0, 0, 0, 0, 'be223f2ae805e5c695639b3b961c08bf', 'FALSE'),
