(2175, '5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC', 'ControlMee', 'ControlMee allows you to use your MeediOS remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.  Supports a keyboard hook and numeric keyboard.', '', 'General', 'None', 'Commercial', 'Beta', '2010-02-21 10:16:53', '2.5', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC/2.5/beta/ControlMee_2.5_Beta.mopp', '202389', '', '', 'readme.html', 2005000000000000000, 0, 'ControlMee allows you to use your MeediOS remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.\n\nDirections at: http://controlmee.hargraveusa.com/\n\n*New for v2.1: Added support for a numeric keyboard.  Use the number keys (2...9) to type letters like on your cell phone.  The max delay setting determines how long the plugin will wait between key presses before resetting the key to its initial numeric value.\n\n***IMPORTANT***\n\nControlMee must be moved above "InputMapper" in the Fulltime Plug-ins list.', 'ControlMee', '', '', '', '', '0', '1', 78, 3394, 0, 0, 0, 0, 'bf8f29dfc893468207d5b59f2ccc7663', 'FALSE'),
