(2185, '0AFCE98C-6B63-4DB0-A0D5-86446C04B127', 'TMinusDelete', 'This importer will delete files after a specified number of days.', '', 'Import', 'None', '', 'Stable', '2010-02-22 21:40:03', '1.0.0.4', 'ccrocker', '', 'ccrocker', '', '', 'plugins/0AFCE98C-6B63-4DB0-A0D5-86446C04B127/1.0.0.4/stable/TMinusDelete_1.0.0.4_Stable.mopp', '43629', '', '', '', 1000000004000000000, 1, 'This importer will delete a file after a specified number of days.  This Importer will create tag named "ArchivePreference" .  This tag should be populated as either "Temporary" or "Permanent"  either manually or via another importer.  Temporary files are subject to deletion after a user selected number of days.  Permanent files are not deleted.  The tag DaysUntilDeletion will count down days each time the importer is run.  When this amount is less than 1, the related file and library item will be deleted.  \n\nCan also be set to delete "Temporary" files after watched.', 'TMinusDelete', 'http://www.meedios.com/forum/viewtopic.php?p=60767#60767', '', '', '', '0', '1', 122, 268, 0, 0, 0, 0, '5ebfd78713e1c0c5e22fee36bdf03438', 'FALSE'),
