(2194, '5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC', 'ControlMee', 'ControlMee allows you to use your MeediOS remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.  Supports a keyboard hook and numeric keyboard.', '', 'General', 'None', 'Commercial', 'Beta', '2010-02-23 14:48:10', '2.5.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC/2.5.1/beta/ControlMee_2.5.1_Beta.mopp', '379836', '', '', 'readme.html', 2005001000000000000, 0, 'ControlMee allows you to use your MeediOS remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.\n\nDirections at: http://controlmee.hargraveusa.com/\n\n*New for v2.1: Added support for a numeric keyboard.  Use the number keys (2...9) to type letters like on your cell phone.  The max delay setting determines how long the plugin will wait between key presses before resetting the key to its initial numeric value.\n\n***IMPORTANT***\n\nControlMee must be moved above "InputMapper" in the Fulltime Plug-ins list.', 'ControlMee', '', '', '', '', '0', '1', 500, 3394, 0, 0, 0, 0, '3fb5c74286786140115de17732df2a82', 'FALSE'),
