(2203, 'FA41FD9F-0CCD-4336-83FB-FD4A7AFF9ECD', 'ExcelImportExport', 'Exports a library section to an Excel file and imports an Excel file into a library section.', '', 'Import', 'None', '', 'Stable', '2010-02-23 15:34:22', '1.2.1', 'Harald D. Wagner', '', 'HdWagner', '(c) 2009 Harald D. Wagner', '', 'plugins/FA41FD9F-0CCD-4336-83FB-FD4A7AFF9ECD/1.2.1/stable/ExcelImportExport_1.2.1_Stable.mopp', '54242', '', '', '', 1002001000000000000, 1, 'This import plugin exports a library section to an Excel file and imports an Excel file into a library section. \n\nInstructions: \nAdd the import to a library section. Choose "import" or "export". Provide a file path. Click "Run selected import".\n\nHints:\nNote that the values of the "ID" column are used as primary key. Imported Excel rows with valid ID will override the the section item with this very ID. Excel rows without (valid) ID will create new section items.\n\nNote also that Excel supports up to 65536 rows, 255 columns, 32767 characters per cell. If your library sections exceeds this, some rows or columns might not be exported.', 'ExcelImportExport', '', 'http://www.meedios.com/OpenMAIDOS/detail.php?plugin_id=FA41FD9F-0CCD-4336-83FB-FD4A7AFF9ECD', '', '', '0', '1', 363, 455, 0, 0, 0, 0, 'd3591a60974953b417d8b813b1f5ca87', 'FALSE'),
