(2719, '818B3077-0449-4B1F-BA4C-BFB5882C760D', 'USB-UIRT', 'Use the USB-UIRT with MeediOS.  Supports both send and receive.', '', 'Input', 'None', 'Commercial', 'Beta', '2010-06-27 20:56:08', '5.2', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2010', '', 'plugins/818B3077-0449-4B1F-BA4C-BFB5882C760D/5.2/beta/USB-UIRT_5.2_Beta.mopp', '118086', '', '', '', 5002000000000000000, 1, 'Set the delay and buffer, and then use the Learn button (in Configuration...Input) to map IR codes to Meedio commands.\n\n***IMPORTANT***\n\nMake sure to add USB-UIRT to the Command Input "Input Sources" list of the UI Plugin (i.e. WPFUI).  If you don''t add it, it won''t work.\n\n*New for v5.0: Added support for a numeric keyboard.  Use the number keys (2...9) to type letters like on your cell phone.  The max delay setting determines how long the plugin will wait between key presses before sending the current key.\n\n*New for v5.1: Added send support.  Use the included "lrnhelper.exe" program to learn the IR codes to send.  Send the message "usb-uirt.send" with the following payloads (code is required, the rest are optional):\n\ncode=IR Code to send\nformat=pronto/raw (default is pronto if this is not included with message)\nrepeat=int(default is 1 if this is not included with message)', 'USB-UIRT', 'http://www.meedios.com/forum/viewtopic.php?t=4888', '', '', '', '0', '1', 304, 13531, 0, 0, 0, 0, '3a061173b3fea46f7901da2081d36da4', 'FALSE'),
(4029, 'D5C4543C-D054-4363-BB9F-B2146ED7E02E', 'PlayMee', 'PlayMee is a video player enhancer. It plays media based on user-defined conditions in any configured external player. Includes: off-line media support with prompt; auto-play of Blu-Ray, HDDVD, DVD, SVCD, VCD, any file-type; automatic mounting of images; ', '', 'General', 'None', 'Commercial', 'Stable', '2012-05-12 03:01:27', '1.3.8', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'enemywithin', '2010', '', 'plugins/D5C4543C-D054-4363-BB9F-B2146ED7E02E/1.3.8/stable/PlayMee_1.3.8_Stable.mopp', '2860493', '', '', 'readme.html', 1003008000000000000, 1, '', 'PlayMee', 'http://playmee.hargraveusa.com', '', '', '', '0', '1', 317, 12299, 0, 0, 0, 0, '27988fa1feb2a7de80dd13932f18e987', 'FALSE'),
