(2319, 'C9E487C3-8A8D-4194-894F-404D22564773', 'TriggerMee', 'Monitor folders for new files, and instantly trigger an importer (or anything)', '', 'General', 'None', '', 'Stable', '2010-03-10 09:00:04', '0.62', 'hisdudity, Original code from binary64', '', 'hisdudity', '2009', '', 'plugins/C9E487C3-8A8D-4194-894F-404D22564773/0.62/stable/TriggerMee_0.62_Stable.mopp', '99031', '', '', 'Readme.txt', 62000000000000000, 0, 'TriggerMee\n\nSend messages when a monitored folder is changed in real-time. A message could trigger an importer to run.\n\n\nOptions help:\n\nFolder to watch = mandatory. a single folder to listen to for changes. subdirectories included. can be unc.\nFile masks = mandatory. file mask(s) to listen for. seperate with a space. example: "*.avi .mpg mpeg" without quotes will listen for avi''s, mpg''s and mpeg''s. just enter "*" without quotes for all files.\nMessage to send = mandatory. a meedio message to send when new file found. example: "meedio.message-subject|tag1=value1|tag2=value2" without quotes.\nOnly trigger when file becomes unlocked = if true, only executes the message when file first becomes unlocked. if false, the message is executed without delay. default of checked is recommended.\nTrigger on load = default=false. if true, when the watcher first connects to a folder, the message will be executed.\nTrigger on reconnect = default=false. if true, when the watcher is reconnected to a folder after having been disconnected, the message will be executed.\nUse Smart Hash feature = default=true. if true, a hash table is maintained reflecting the directory monitored.. after a reconnect or connect, if the table has changed, the message will be executed.\n\nReconnect to disconnected paths (global option) = [integer] Used for when plugin is watching a UNC share, and server connection is lost. How many seconds should this plugin attempt reconnection to all disconnected watchers? Specify -1 or 0 to turn this feature off (not recommended). Blank this entry to use the internal default.\nThrottle trigger (global option) = [integer] Don''t re-trigger the same trigger if trigger triggered in the last x seconds. Blank this entry to use defaults. Any throttled triggers currently get lost/ignored.', 'TriggerMee', 'http://www.meedios.com/forum/viewtopic.php?t=', '', '', '', '0', '1', 5, 26336, 0, 0, 0, 0, '5ec659d730753e2bfdd85ffb3f0d8666', 'FALSE'),
(2320, 'C9E487C3-8A8D-4194-894F-404D22564773', 'TriggerMee', 'Monitor folders for new files, and instantly trigger an importer (or anything)', '', 'General', 'None', '', 'Stable', '2010-03-10 09:36:21', '0.63', 'hisdudity, Original code from binary64', '', 'hisdudity', '2009', '', 'plugins/C9E487C3-8A8D-4194-894F-404D22564773/0.63/stable/TriggerMee_0.63_Stable.mopp', '99081', '', '', 'Readme.txt', 63000000000000000, 0, 'TriggerMee\n\nSend messages when a monitored folder is changed in real-time. A message could trigger an importer to run.\n\n\nOptions help:\n\nFolder to watch = mandatory. a single folder to listen to for changes. subdirectories included. can be unc.\nFile masks = mandatory. file mask(s) to listen for. seperate with a space. example: "*.avi .mpg mpeg" without quotes will listen for avi''s, mpg''s and mpeg''s. just enter "*" without quotes for all files.\nMessage to send = mandatory. a meedio message to send when new file found. example: "meedio.message-subject|tag1=value1|tag2=value2" without quotes.\nOnly trigger when file becomes unlocked = if true, only executes the message when file first becomes unlocked. if false, the message is executed without delay. default of checked is recommended.\nTrigger on load = default=false. if true, when the watcher first connects to a folder, the message will be executed.\nTrigger on reconnect = default=false. if true, when the watcher is reconnected to a folder after having been disconnected, the message will be executed.\nUse Smart Hash feature = default=true. if true, a hash table is maintained reflecting the directory monitored.. after a reconnect or connect, if the table has changed, the message will be executed.\n\nReconnect to disconnected paths (global option) = [integer] Used for when plugin is watching a UNC share, and server connection is lost. How many seconds should this plugin attempt reconnection to all disconnected watchers? Specify -1 or 0 to turn this feature off (not recommended). Blank this entry to use the internal default.\nThrottle trigger (global option) = [integer] Don''t re-trigger the same trigger if trigger triggered in the last x seconds. Blank this entry to use defaults. Any throttled triggers currently get lost/ignored.', 'TriggerMee', 'http://www.meedios.com/forum/viewtopic.php?t=', '', '', '', '0', '1', 511, 26336, 0, 0, 0, 0, '0b45d2de59f0fa892dd0adf533c21f80', 'FALSE'),
