(2346, '4102A50D-53D6-468C-8A4B-77DEC5301437', 'iPod Video Encoder', 'Encode video to H264 for iPod', '', 'Import', 'None', '', 'Beta', '2010-03-14 15:10:18', '1.0.0.3', 'ccrocker', '', 'ccrocker', '', '', 'plugins/4102A50D-53D6-468C-8A4B-77DEC5301437/1.0.0.3/beta/iPod_Video_Encoder_1.0.0.3_Beta.mopp', '1074533', '', '', '', 1000000003000000000, 0, 'iPod Video Encoder\nhttp://www.meedios.com/OpenMAIDOS/detail.php?plugin_id=4102A50D-53D6-468C-8A4B-77DEC5301437\n\niPod Video Encoder works with the next version of MeePopupProvider which will have an "Add to iPod" option.  When the  "Add to iPod" button is selected, a library tag named "AddToiPod" is added to the library and set to "True".  iPod Video Encoder will run on a video library and encode each item that has the "AddToiPod" tag set to true. The video is encoded to H264, named using the library Title tag, and coverart is added using the Image tag. The video is then added to a local queue folder. When all items are processed, the queue folder is moved to the final destination (ie NAS) and then optionally added to iTunes. \n\nGeneral Options\n\n- Maximum Video Width - Enter the maximum video width supported by your iPod.  640 is supported by the iPhone, iPod Touch, and current iPod Classic.\n\n- Directory to Save Your Media - This is the folder that you want your processed and encoded video saved to.  This may be a folder on a local drive or a network drive.\n\n- Local Temporary Directory - The importer may create various temporary files during the process.  These files are deleted after the encoding process.  Select a folder to store these temporary files.  This should be a folder on a local drive.  Do not use a network folder.\n\n- Local Queue Directory - As each library item is processed, the final encoded file is temporarily stored on a local drive.  After all files have been processed, each file in the queue is moved to the final directory.  This should be a folder on a local drive.  Do not use a network folder.  This folder must be different than the Local Temporary Directory.\n\n\nRequired Support Programs (All are free):\n\n- MeePopupProvider - iPod Video Encoder will only process library items that has the "AddToiPod" tag set to true.  MeePopupProvider will provide this functionality.  Alternatively, you can manually create this tag in your library and set it to true.   http://www.meedios.com/forum/viewtopic.php?p=71539#71539\n\n- Handbrake CLI - This program does the actual encoding and is required.  Handbrake can be found here:  http://handbrake.fr/downloads.php  Make sure you download and install the CLI version.  Note that the CLI version should also be included in the GUI version.\n\n- eac3to - Required if the video is in a Blu-Ray format.  Eac3to can be found here:  http://forum.doom9.org/showthread.php?t=125966\n\n- MkvMerge - Required if the video is in a Blu-Ray format.  MkvMerge can be found here:  http://www.bunkus.org/videotools/mkvtoolnix/downloads.html  Scroll to the Windows section at the bottom of the page and install the mkvtoolnix package.  MkvMerge is installed as part of this package.\n\n- Virtual Clone Drive - Required if your videos are formated ISO files.  Daemon Tools is not supported.  Virtual Clone Drive can be found here:  http://www.slysoft.com/en/virtual-clonedrive.html\n\n\nPlease note that this program and the supporting programs do not remove any copy protection.', 'iPod Video Encoder', 'http://www.meedios.com/forum/viewtopic.php?p=79223#79223', 'http://www.meedios.com/OpenMAIDOS/detail.php?plugin_id=4102A50D-53D6-468C-8A4B-77DEC5301437', '', '', '0', '1', 2, 195, 0, 0, 0, 0, '1c342a4ee007d6af2987f77d00ac31ff', 'FALSE'),
(2347, '4102A50D-53D6-468C-8A4B-77DEC5301437', 'iPod Video Encoder', 'Encode video to H264 for iPod', '', 'Import', 'None', '', 'Beta', '2010-03-15 01:24:10', '1.0.0.4', 'ccrocker', '', 'ccrocker', '', '', 'plugins/4102A50D-53D6-468C-8A4B-77DEC5301437/1.0.0.4/beta/iPod_Video_Encoder_1.0.0.4_Beta.mopp', '1074608', '', '', '', 1000000004000000000, 1, 'iPod Video Encoder\nhttp://www.meedios.com/OpenMAIDOS/detail.php?plugin_id=4102A50D-53D6-468C-8A4B-77DEC5301437\n\niPod Video Encoder works with the next version of MeePopupProvider which will have an "Add to iPod" option.  When the  "Add to iPod" button is selected, a library tag named "AddToiPod" is added to the library and set to "True".  iPod Video Encoder will run on a video library and encode each item that has the "AddToiPod" tag set to true. The video is encoded to H264, named using the library Title tag, and coverart is added using the Image tag. The video is then added to a local queue folder. When all items are processed, the queue folder is moved to the final destination (ie NAS) and then optionally added to iTunes. \n\nGeneral Options\n\n- Maximum Video Width - Enter the maximum video width supported by your iPod.  640 is supported by the iPhone, iPod Touch, and current iPod Classic.\n\n- Directory to Save Your Media - This is the folder that you want your processed and encoded video saved to.  This may be a folder on a local drive or a network drive.\n\n- Local Temporary Directory - The importer may create various temporary files during the process.  These files are deleted after the encoding process.  Select a folder to store these temporary files.  This should be a folder on a local drive.  Do not use a network folder.\n\n- Local Queue Directory - As each library item is processed, the final encoded file is temporarily stored on a local drive.  After all files have been processed, each file in the queue is moved to the final directory.  This should be a folder on a local drive.  Do not use a network folder.  This folder must be different than the Local Temporary Directory.\n\n\nRequired Support Programs (All are free):\n\n- MeePopupProvider - iPod Video Encoder will only process library items that has the "AddToiPod" tag set to true.  MeePopupProvider will provide this functionality.  Alternatively, you can manually create this tag in your library and set it to true.   http://www.meedios.com/forum/viewtopic.php?p=71539#71539\n\n- Handbrake CLI - This program does the actual encoding and is required.  Handbrake can be found here:  http://handbrake.fr/downloads.php  Make sure you download and install the CLI version.  Note that the CLI version should also be included in the GUI version.\n\n- eac3to - Required if the video is in a Blu-Ray format.  Eac3to can be found here:  http://forum.doom9.org/showthread.php?t=125966\n\n- MkvMerge - Required if the video is in a Blu-Ray format.  MkvMerge can be found here:  http://www.bunkus.org/videotools/mkvtoolnix/downloads.html  Scroll to the Windows section at the bottom of the page and install the mkvtoolnix package.  MkvMerge is installed as part of this package.\n\n- Virtual Clone Drive - Required if your videos are formated ISO files.  Daemon Tools is not supported.  Virtual Clone Drive can be found here:  http://www.slysoft.com/en/virtual-clonedrive.html\n\n\nPlease note that this program and the supporting programs do not remove any copy protection.', 'iPod Video Encoder', 'http://www.meedios.com/forum/viewtopic.php?p=79223#79223', 'http://www.meedios.com/OpenMAIDOS/detail.php?plugin_id=4102A50D-53D6-468C-8A4B-77DEC5301437', '', '', '0', '1', 192, 195, 0, 0, 0, 0, '27b3e22cedd71dffee84d3d0f35d37c3', 'FALSE'),
