(2355, 'B0DEDED6-3617-4B67-B38F-507813C88C0C', 'BTVImporter2 for BTV 4.8.1+', 'Import show information from your BeyondTV (v4.8.1+) library into MeediOS', '', 'Import', 'None', 'Freeware', 'Alpha', '2010-03-18 22:32:07', '3.0', 'artfulfox', '', 'artfulfox', '2010 ArtfulfoxSoftware', 'http://www.meedios.com/forum/viewtopic.php?p=79479#79479', 'plugins/B0DEDED6-3617-4B67-B38F-507813C88C0C/3.0/alpha/BTVImporter_2_for_BTV_4.8.1~_3.0_Alpha.mopp', '309059', '', '', '', 3000000000000000000, 0, 'This version of BTVImporter is compatible with BeyondTV versions 4.8.1 and higher. \r\nThe BeyondTV Login API changed in version 4.8.1. For that reason this plugin will *not* work with any version of BTV prior to v4.8.1.\r\n      \r\nThis version of the BTVImporter has a Debug switch. The Debug switch when enabled will create a new log file every day. It will append debug information to the same log file if the date has not changed. Please note that there is a very large amount of debug information written to the log files so they can take up a lot of disk space. Enable this only if you are having problems.\r\n    \r\nLog files are written to the Logs sub-directory in the MeediOS data directory (default is c:\\meedios\\data\\logs).\r\nThis is a very rough version... if you find bugs, let me know!', 'BTVImporter2', '', '', '3.0.0', '', '0', '1', 0, 240, 0, 0, 0, 0, '08422ff2aea8c61a6f1d9a54d26f3d5a', 'FALSE'),
