(2781, '844FCFE7-19AD-4B08-8175-AA11EFAF75A0', 'TVShowsFileImporter', 'Add TVShows in your library', '', 'Import', 'None', 'Donationware', 'Beta', '2010-08-14 08:49:30', '1.2.2', 'Flop', 'flop@meedios-france.com', 'flclsd', 'Meedios', '', 'plugins/844FCFE7-19AD-4B08-8175-AA11EFAF75A0/1.2.2/beta/TVShowsFileImporter_1.2.2_Beta.mopp', '117202', '', '', '', 1002002000000000000, 0, 'Use MediaFolder for set your TVShows folder(s), add this importer in your library and just run', 'TVShowsFileImporter', 'www.meedios-france.com', 'http://www.meedios.com/forum/viewtopic.php?t=5756', '', '', '0', '1', 326, 3228, 0, 0, 0, 0, '25d2ea6fed6da3f32b4fbebe20ddc85c', 'FALSE'),
(2363, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Beta', '2010-03-19 21:44:11', '2.0.2.2', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.0.2.2/beta/DiscID_2.0.2.2_Beta.mopp', '2158364', '', '', 'ReadMe.txt', 2000002002000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.  Options to backup audio, video, or photos are dependent on populated root directories using the "Media Locations" importer plugin.  Add a new section to your MeediOS library named "GlobalPluginProperties" and then add the MediaLocations plugin to that library. Set the "Save To" locations for your media.', 'DiscID', '', '', '', '', '0', '1', 34, 71175, 0, 0, 0, 0, '3f7f0a121359607893236dd82889a00d', 'FALSE'),
