(2717, '818B3077-0449-4B1F-BA4C-BFB5882C760D', 'USB-UIRT', 'Use the USB-UIRT with MeediOS.  Supports both send and receive.', '', 'Input', 'None', 'Commercial', 'Beta', '2010-06-26 12:01:47', '5.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2010', '', 'plugins/818B3077-0449-4B1F-BA4C-BFB5882C760D/5.1/beta/USB-UIRT_5.1_Beta.mopp', '120241', '', '', '', 5001000000000000000, 0, 'Set the delay and buffer, and then use the Learn button (in Configuration...Input) to map IR codes to Meedio commands.\n\n\n\n\n\n\n\n***IMPORTANT***\n\n\n\n\n\n\n\nMake sure to add USB-UIRT to the Command Input "Input Sources" list of the UI Plugin (i.e. WPFUI).  If you don''t add it, it won''t work.\n\n\n\n\n\n*New for v3.0: Added support for a numeric keyboard.  Use the number keys (2...9) to type letters like on your cell phone.  The max delay setting determines how long the plugin will wait between key presses before sending the current key.\n\n\n\n\n*New for v3.1: Added send support.  Use the message "usb-uirt.send" with the following payloads (code is required, the rest are optional):\n\ncode=IR Code to send\nformat=pronto/raw (default is pronto if this is not included with message)\nrepeat=int(default is 1 is this is not included with message)', 'USB-UIRT', 'http://www.meedios.com/forum/viewtopic.php?t=4888', '', '', '', '0', '1', 12, 13531, 0, 0, 0, 0, 'b91f1b24c262725e440003bbdaa48248', 'FALSE'),
