(2715, 'D5C4543C-D054-4363-BB9F-B2146ED7E02E', 'PlayMee', 'PlayMee is a video player enhancer. It plays media based on user-defined conditions in MeediOS or external players. Includes: off-line media support with prompts; auto-play of DVD, SVCD, VCD, any file-type; automatic mounting of images; Intro/Trailer supp', '', 'General', 'None', 'Commercial', 'Stable', '2010-06-25 21:38:18', '0.9.5', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/D5C4543C-D054-4363-BB9F-B2146ED7E02E/0.9.5/stable/PlayMee_0.9.5_Stable.mopp', '1284309', '', '', 'readme.html', 9005000000000000, 0, '', 'PlayMee', 'http://playmee.hargraveusa.com', '', '', '', '0', '1', 40, 12299, 0, 0, 0, 0, '7bdacedcc82d5efaecbbd815bd1be107', 'FALSE'),
