(2714, '5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC', 'ControlMee', 'ControlMee allows you to use your MeediOS remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.  Supports a keyboard hook and numeric keyboard.', '', 'General', 'None', 'Commercial', 'Beta', '2010-06-25 21:36:01', '3.0', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC/3.0/beta/ControlMee_3.0_Beta.mopp', '390257', '', '', 'readme.html', 3000000000000000000, 0, 'ControlMee allows you to use your MeediOS remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.\n\nDirections at: http://controlmee.hargraveusa.com/\n\n*New for v2.1: Added support for a numeric keyboard.  Use the number keys (2...9) to type letters like on your cell phone.  The max delay setting determines how long the plugin will wait between key presses before resetting the key to its initial numeric value.\n\n***IMPORTANT***\n\nControlMee must be moved above "InputMapper" in the Fulltime Plug-ins list.', 'ControlMee', '', '', '', '', '0', '1', 8, 3394, 0, 0, 0, 0, 'fe4769435e81fb45e69db9024dbcf839', 'FALSE'),
(2536, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Beta', '2010-05-05 21:15:05', '2.0.3.2', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.0.3.2/beta/DiscID_2.0.3.2_Beta.mopp', '2150529', '', '', 'ReadMe.txt', 2000003002000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.  Options to backup audio, video, or photos are dependent on populated root directories using the "Media Locations" importer plugin.  Add a new section to your MeediOS library named "GlobalPluginProperties" and then add the MediaLocations plugin to that library. Set the "Save To" locations for your media.', 'DiscID', '', '', '', '', '0', '1', 23, 71175, 0, 0, 0, 0, 'fd342ff0f70ebc3fdb5c1ea3bfdfdd13', 'FALSE'),
(2713, '818B3077-0449-4B1F-BA4C-BFB5882C760D', 'USB-UIRT', 'Use the USB-UIRT with MeediOS.  Supports receive only at this time.', '', 'Input', 'None', 'Commercial', 'Beta', '2010-06-25 21:05:05', '5.0', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2009', '', 'plugins/818B3077-0449-4B1F-BA4C-BFB5882C760D/5.0/beta/USB-UIRT_5.0_Beta.mopp', '119704', '', '', '', 5000000000000000000, 0, 'Set the delay and buffer, and then use the Learn button (in Configuration...Input) to map IR codes to Meedio commands.\n\n***IMPORTANT***\n\nMake sure to add USB-UIRT to the Command Input "Input Sources" list of the UI Plugin (i.e. WPFUI).  If you don''t add it, it won''t work.', 'USB-UIRT', 'http://www.meedios.com/forum/viewtopic.php?t=4888', '', '', '', '0', '1', 9, 13531, 0, 0, 0, 0, '36707c7458d271e6d286afda70d6783f', 'FALSE'),
