(2544, 'B0DEDED6-3617-4B67-B38F-507813C88C0C', 'BTVImporter 2 for BTV 4.8.1+', 'Import show information from your BeyondTV library into MeediOS', '', 'Import', 'None', 'Freeware', 'Beta', '2010-05-06 21:25:56', '3.0.1', 'artfulfox', '', 'artfulfox', '2010 ArtfulfoxSoftware', 'http://www.meedios.com/forum/viewtopic.php?t=5862&start=0&postdays=0&postorder=asc&highlight=', 'plugins/B0DEDED6-3617-4B67-B38F-507813C88C0C/3.0.1/beta/BTVImporter_2_for_BTV_4.8.1~_3.0.1_Beta.mopp', '309065', '', '', '', 3000001000000000000, 1, 'This version of BTVImporter is compatible with BeyondTV versions 4.8.1 and higher. \r\nThe BeyondTV Login API changed in version 4.8.1. For that reason this plugin will *not* work with any version of BTV prior to v4.8.1.\r\n      \r\n\r\nThis version of the BTVImporter has a Debug switch. The Debug switch when enabled will create a new log file every day. It will append debug information to the same log file if the date has not changed. Please note that there is a very large amount of debug information written to the log files so they can take up a lot of disk space. Enable this only if you are having problems.\r\n    \r\nLog files are written to the Logs subdirectory in the MeediOS data directory (default is c:\\meedios\\data\\logs).\r\nThis is a very rough version... if you find bugs, let me know!', 'BTVImporter2', '', '', '3.0.0', '', '0', '1', 240, 240, 0, 0, 0, 0, 'ea29fefc692b455990f75006857c8365', 'FALSE'),
