(2549, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Beta', '2010-05-07 23:44:26', '2.0.3.4', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.0.3.4/beta/DiscID_2.0.3.4_Beta.mopp', '2150946', '', '', 'ReadMe.txt', 2000003004000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.  Options to backup audio, video, or photos are dependent on populated root directories using the "Media Locations" importer plugin.  Add a new section to your MeediOS library named "GlobalPluginProperties" and then add the MediaLocations plugin to that library. Set the "Save To" locations for your media.', 'DiscID', '', '', '', '', '0', '1', 3, 71175, 0, 0, 0, 0, '84bedac0b26410d447d6558159a53b31', 'FALSE'),
(2550, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Beta', '2010-05-08 00:10:45', '2.0.3.5', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.0.3.5/beta/DiscID_2.0.3.5_Beta.mopp', '2150945', '', '', 'ReadMe.txt', 2000003005000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.  Options to backup audio, video, or photos are dependent on populated root directories using the "Media Locations" importer plugin.  Add a new section to your MeediOS library named "GlobalPluginProperties" and then add the MediaLocations plugin to that library. Set the "Save To" locations for your media.', 'DiscID', '', '', '', '', '0', '1', 39, 71175, 0, 0, 0, 0, '94281a101660201dfd44e39a01859e9c', 'FALSE'),
