(2711, '2E9AEFE6-E114-4826-8D39-78EFEBE87806', 'TiVo TVAP Importer', 'Import meta data from text files created by TVAP for TiVo transfers', '', 'Import', 'None', '', 'Beta', '2010-06-24 22:44:36', '1.0.0.0', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2E9AEFE6-E114-4826-8D39-78EFEBE87806/1.0.0.0/beta/TiVo_TVAP_Importer_1.0.0.0_Beta.mopp', '64718', '', '', '', 1000000000000000000, 1, 'http://www.tivocommunity.com/tivo-vb/showthread.php?t=359550\n\nTVAP is a free utility program for TiVo-to-Go (e.g., TiVo Desktop or TiVoPlaylist) users who use VideoReDo (Plus or TV Suite) for editing transferred TiVo files. It runs on a Windows computer with VideoReDo (VRD) and TiVo Desktop installed (for registry settings only). TVAP detects TiVo files being transferred and, when transfer completes, it automatically and silently runs VideoReDo processes on the files as configured by the operator in the program GUI.', 'TiVo TVAP Importer', '', '', '', '', '0', '1', 98, 98, 0, 0, 0, 0, '38ec6088e16db0a0777289b72f104c59', 'FALSE'),
