(2973, '7A47417D-070D-474B-BE34-6D11DE6B319F', 'FileRenamer', 'Rename and move files and directories based on library tags', '', 'Import', 'None', '', 'Stable', '2010-12-12 18:55:22', '1.0.3.1', 'ccrocker', '', 'ccrocker', '', '', 'plugins/7A47417D-070D-474B-BE34-6D11DE6B319F/1.0.3.1/stable/FileRenamer_1.0.3.1_Stable.mopp', '46709', '', '', '', 1000003001000000000, 0, 'WARNING. Before you just run this with blind trust on your library, I recommend testing with a few file copies in a test library. I have run it on my complete library and everything was renamed without error, but I can''t test every scenario...  If you don''t test and your files go POOF, consider your warned...', 'FileRenamer', '', '', '', '', '0', '1', 2, 2999, 0, 0, 0, 0, 'eb8647ed3dcf5099de266c3942d350f2', 'FALSE'),
