(3058, 'E8FAA3D7-5B76-4419-BA6D-45C29ECA4492', 'MoviesFileImporter', 'This importer reads movie names from a directory or file name into your libary', '', 'Import', 'None', 'Donationware', 'Stable', '2011-02-19 16:29:45', '1.5.1', 'Flop', 'flop@meedios-france.com', 'flclsd', 'Â© 2010, Flclsd', '', 'plugins/E8FAA3D7-5B76-4419-BA6D-45C29ECA4492/1.5.1/stable/MoviesFileImporter_1.5.1_Stable.mopp', '273084', '', '', '', 1005001000000000000, 0, 'Use MediaFolders for set your Movies folder(s), add this importer in your library and just run - If you want use your own regex, add you regex file with this name and in this folder :\nC:\\MeediOS\\data\\PluginsSettings\\MoviesFileImporter\\CustomRegex.txt', 'MoviesFileImporter', 'www.meedios-france.com', 'http://www.meedios.com/forum/viewtopic.php?t=5934', '', '', '0', '1', 81, 4624, 0, 0, 0, 0, '829bf8b86cea7415b335e76d982da6f2', 'FALSE'),
(3060, '1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4', 'Default Icon Theme', 'Icons for Meedios Default Theme', '', 'Icon', 'None', '', 'Alpha', '2011-02-20 12:54:22', '1.0.2', 'Harald D. Wagner and Skypichat', '', 'skypichat', '2007-2011, Harald D. Wagner', '', 'plugins/1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4/1.0.2/alpha/Default_Icon_Theme_1.0.2_Alpha.mopp', '5185797', '', '', 'DefaultTheme.txt', 1000002000000000000, 0, 'This is the default icon theme\n\n\nIt''s a standalone icon theme. It''s also the fallback theme for other (incomplete) icon themes.\n\n\n\nAdditionally it provides icons for non-themed applications like ConfigurationEditor: \n\n"user" is used as default user icon in ConfigurationEditor.exe\n"default" is used as last fallback possibility by MeediOS.exe if a given file or resource does not exist.\n\n\n\nThe mapping of resource names and file names is done on a per-UI-type basis.\nResource names are UI independant, file names may be individual to the UI type. \nResource names are theme independant, file names may be individual to the current theme.\nResourceDictionary.WPFUI.xaml defines the mapping for WPFUI, ResourceDictionary.WinFormUI.XML defines the mapping for WinFormUI.\n\n\n\nIcon resource names should have the following format:\n\nPlugin name "radio", "music", ..., if applicable.\nPlugin type "-module", "-general", ..., if applicable.\nTask "-up", "-record", "-show", "-modify", "-rating", "-rotate", ..., if applicable.\nState "-sel","-unsel", "-active", "-inactive", "-down"/"-pressed", "-tv14", "-left", ... , if applicable.\nPlace to find "-background", "-frame", "-indicator", ..., if applicable.\nSuffix "-icon".\n\nIcon file names should have the same format plus the adequate file extension.', 'default', '', '', '', '', '0', '1', 3, 327, 0, 0, 0, 0, 'df65487926e209ef27018552eb3ecc49', 'FALSE'),
(3063, '1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4', 'Default Icon Theme', 'Icons for Meedios Default Theme', '', 'Icon', 'None', '', 'Alpha', '2011-02-20 15:37:57', '1.0.4', 'Harald D. Wagner and Skypichat', '', 'skypichat', '2007-2011, Harald D. Wagner', '', 'plugins/1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4/1.0.4/alpha/Default_Icon_Theme_1.0.4_Alpha.mopp', '5286450', '', '', 'DefaultTheme.txt', 1000004000000000000, 0, 'This is the default icon theme\n\n\nIt''s a standalone icon theme. It''s also the fallback theme for other (incomplete) icon themes.\n\n\n\nAdditionally it provides icons for non-themed applications like ConfigurationEditor: \n\n"user" is used as default user icon in ConfigurationEditor.exe\n"default" is used as last fallback possibility by MeediOS.exe if a given file or resource does not exist.\n\n\n\nThe mapping of resource names and file names is done on a per-UI-type basis.\nResource names are UI independant, file names may be individual to the UI type. \nResource names are theme independant, file names may be individual to the current theme.\nResourceDictionary.WPFUI.xaml defines the mapping for WPFUI, ResourceDictionary.WinFormUI.XML defines the mapping for WinFormUI.\n\n\n\nIcon resource names should have the following format:\n\nPlugin name "radio", "music", ..., if applicable.\nPlugin type "-module", "-general", ..., if applicable.\nTask "-up", "-record", "-show", "-modify", "-rating", "-rotate", ..., if applicable.\nState "-sel","-unsel", "-active", "-inactive", "-down"/"-pressed", "-tv14", "-left", ... , if applicable.\nPlace to find "-background", "-frame", "-indicator", ..., if applicable.\nSuffix "-icon".\n\nIcon file names should have the same format plus the adequate file extension.', 'default', '', '', '', '', '0', '1', 2, 327, 0, 0, 0, 0, 'd728db42d708ef40a9d01ef2744b4d0f', 'FALSE'),
(3061, '9182CE00-A1F6-48FB-9763-3197B7FA420A', 'meeTagsRemover', 'Import for deleted unnecessary field in your library (eg : composer, comments..)', '', 'Import', 'None', 'Donationware', 'Stable', '2011-02-20 13:24:25', '1.1.0', 'Flop', 'flop@meedios-france.com', 'flclsd', 'Meedios', '', 'plugins/9182CE00-A1F6-48FB-9763-3197B7FA420A/1.1.0/stable/meeTagsRemover_1.1.0_Stable.mopp', '90413', '', '', '', 1001000000000000000, 0, 'Instructions\n : Create new importer under your library, set the name of field you want deleted. (one ligne for one field)\n\nYou can also delete automatically all field empty\n\nIn all case the fiel use by view steep is not deleted.', 'meeTagsRemovers', 'www.meedios-france.com', 'http://www.meedios.com/forum/viewtopic.php?t=4545', '', '', '0', '1', 12, 349, 0, 0, 0, 0, '7cc5821ab157a5fcf4e10067e36486da', 'FALSE'),
(3064, '1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4', 'Default Icon Theme', 'Icons for Meedios Default Theme', '', 'Icon', 'None', '', 'Alpha', '2011-02-20 16:04:23', '1.0.5', 'Harald D. Wagner and Skypichat', '', 'skypichat', '2007-2011, Harald D. Wagner', '', 'plugins/1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4/1.0.5/alpha/Default_Icon_Theme_1.0.5_Alpha.mopp', '5286442', '', '', 'DefaultTheme.txt', 1000005000000000000, 0, 'This is the default icon theme\n\n\nIt''s a standalone icon theme. It''s also the fallback theme for other (incomplete) icon themes.\n\n\n\nAdditionally it provides icons for non-themed applications like ConfigurationEditor: \n\n"user" is used as default user icon in ConfigurationEditor.exe\n"default" is used as last fallback possibility by MeediOS.exe if a given file or resource does not exist.\n\n\n\nThe mapping of resource names and file names is done on a per-UI-type basis.\nResource names are UI independant, file names may be individual to the UI type. \nResource names are theme independant, file names may be individual to the current theme.\nResourceDictionary.WPFUI.xaml defines the mapping for WPFUI, ResourceDictionary.WinFormUI.XML defines the mapping for WinFormUI.\n\n\n\nIcon resource names should have the following format:\n\nPlugin name "radio", "music", ..., if applicable.\nPlugin type "-module", "-general", ..., if applicable.\nTask "-up", "-record", "-show", "-modify", "-rating", "-rotate", ..., if applicable.\nState "-sel","-unsel", "-active", "-inactive", "-down"/"-pressed", "-tv14", "-left", ... , if applicable.\nPlace to find "-background", "-frame", "-indicator", ..., if applicable.\nSuffix "-icon".\n\nIcon file names should have the same format plus the adequate file extension.', 'default', '', '', '', '', '0', '1', 11, 327, 0, 0, 0, 0, '277684d1be4910338270b89938fb5c1f', 'FALSE'),
