(3068, '1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4', 'Default Icon Theme', 'Icons for Meedios Default Theme', '', 'Icon', 'None', '', 'Alpha', '2011-02-20 23:10:42', '1.0.6', 'Harald D. Wagner and Skypichat', '', 'skypichat', '2007-2011, Harald D. Wagner', '', 'plugins/1ADAAA06-4EC2-47FE-A7A9-0F39F9776ED4/1.0.6/alpha/Default_Icon_Theme_1.0.6_Alpha.mopp', '5670515', '', '', 'DefaultTheme.txt', 1000006000000000000, 0, 'This is the default icon theme\n\n\nIt''s a standalone icon theme. It''s also the fallback theme for other (incomplete) icon themes.\n\n\n\nAdditionally it provides icons for non-themed applications like ConfigurationEditor: \n\n"user" is used as default user icon in ConfigurationEditor.exe\n"default" is used as last fallback possibility by MeediOS.exe if a given file or resource does not exist.\n\n\n\nThe mapping of resource names and file names is done on a per-UI-type basis.\nResource names are UI independant, file names may be individual to the UI type. \nResource names are theme independant, file names may be individual to the current theme.\nResourceDictionary.WPFUI.xaml defines the mapping for WPFUI, ResourceDictionary.WinFormUI.XML defines the mapping for WinFormUI.\n\n\n\nIcon resource names should have the following format:\n\nPlugin name "radio", "music", ..., if applicable.\nPlugin type "-module", "-general", ..., if applicable.\nTask "-up", "-record", "-show", "-modify", "-rating", "-rotate", ..., if applicable.\nState "-sel","-unsel", "-active", "-inactive", "-down"/"-pressed", "-tv14", "-left", ... , if applicable.\nPlace to find "-background", "-frame", "-indicator", ..., if applicable.\nSuffix "-icon".\n\nIcon file names should have the same format plus the adequate file extension.', 'default', '', '', '', '', '0', '1', 119, 327, 0, 0, 0, 0, 'a87ddb203cb7afa20d0dc4840abb7cc3', 'FALSE'),
