(3134, 'D5C4543C-D054-4363-BB9F-B2146ED7E02E', 'PlayMee', 'PlayMee is a video player enhancer. It plays media based on user-defined conditions in any configured external player. Includes: off-line media support with prompt; auto-play of Blu-Ray, HDDVD, DVD, SVCD, VCD, any file-type; automatic mounting of images; ', '', 'General', 'None', 'Commercial', 'Stable', '2011-05-17 00:51:18', '1.2.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'enemywithin', '2010', '', 'plugins/D5C4543C-D054-4363-BB9F-B2146ED7E02E/1.2.1/stable/PlayMee_1.2.1_Stable.mopp', '2858555', '', '', 'readme.html', 1002001000000000000, 0, '', 'PlayMee', 'http://playmee.hargraveusa.com', '', '', '', '0', '1', 769, 12299, 0, 0, 0, 0, '9b6a2a40e368a41f1b8818311a5484ea', 'FALSE'),
(3473, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Beta', '2011-11-20 00:35:49', '2.1.0.3', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.1.0.3/beta/DiscID_2.1.0.3_Beta.mopp', '7797955', '', '', 'ReadMe.txt', 2001000003000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.', 'DiscID', '', '', '', '', '0', '1', 23, 71175, 0, 0, 0, 0, '4dfd6164d1844fbf04896ff9c203dd6a', 'FALSE'),
