(3626, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Beta', '2011-12-17 04:46:59', '2.1.1.5', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.1.1.5/beta/DiscID_2.1.1.5_Beta.mopp', '7802255', '', '', 'ReadMe.txt', 2001001005000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.', 'DiscID', '', '', '', '', '0', '1', 69, 71175, 0, 0, 0, 0, 'fae8d2ebcf09f8788dd42b75a43d3916', 'FALSE'),
(3627, 'D5C4543C-D054-4363-BB9F-B2146ED7E02E', 'PlayMee', 'PlayMee is a video player enhancer. It plays media based on user-defined conditions in any configured external player. Includes: off-line media support with prompt; auto-play of Blu-Ray, HDDVD, DVD, SVCD, VCD, any file-type; automatic mounting of images; ', '', 'General', 'None', 'Commercial', 'Stable', '2011-12-17 16:41:56', '1.3.4', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'enemywithin', '2010', '', 'plugins/D5C4543C-D054-4363-BB9F-B2146ED7E02E/1.3.4/stable/PlayMee_1.3.4_Stable.mopp', '2860199', '', '', 'readme.html', 1003004000000000000, 0, '', 'PlayMee', 'http://playmee.hargraveusa.com', '', '', '', '0', '1', 174, 12299, 0, 0, 0, 0, 'e78cf026bf905490c0342e518063e577', 'FALSE'),
