(3899, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Beta', '2012-04-07 05:38:00', '2.1.3.3', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.1.3.3/beta/DiscID_2.1.3.3_Beta.mopp', '7820068', '', '', 'ReadMe.txt', 2001003003000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.', 'DiscID', '', '', '', '', '0', '1', 3, 71175, 0, 0, 0, 0, 'a9b4529267b133e82458f636a02429bb', 'FALSE');
