(4147, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Stable', '2012-08-04 22:55:06', '2.1.4.5', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.1.4.5/stable/DiscID_2.1.4.5_Stable.mopp', '7953517', '', '', 'ReadMe.txt', 2001004005000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.', 'DiscID', '', '', '', '', '0', '1', 19, 71175, 0, 0, 0, 0, 'b295b66916ef4d5f30c5c6c4a580612d', 'FALSE'),
(4148, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Stable', '2012-08-06 06:44:50', '2.1.4.6', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.1.4.6/stable/DiscID_2.1.4.6_Stable.mopp', '7953659', '', '', 'ReadMe.txt', 2001004006000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.', 'DiscID', '', '', '', '', '0', '1', 59, 71175, 0, 0, 0, 0, '6263d19584d2de342e1c01f109b48028', 'FALSE'),
(4149, '844FCFE7-19AD-4B08-8175-AA11EFAF75A0', 'TVShowsFileImporter', 'This importer reads tvshow names, episode and series numbers from a directory or file name into your libary', '', 'Import', 'None', 'Donationware', 'Stable', '2012-08-06 20:02:07', '2.0.6', 'Flop', 'flop@meedios-france.com', 'skypichat', 'Â© 2010, Flclsd', '', 'plugins/844FCFE7-19AD-4B08-8175-AA11EFAF75A0/2.0.6/stable/TVShowsFileImporter_2.0.6_Stable.mopp', '251848', '', '', '', 2000006000000000000, 1, '- Use MediaFolder for set your TVShows folder(s), add this importer in your library and just run- If you want use your own regex, add you regex file with this name and in this folder :\nC:\\MeediOS\\data\\PluginsSettings\\TVShowsFileImporter\\CustomRegex.txt', 'TVShowsFileImporter', 'www.meedios-france.com', 'http://www.meedios.com/forum/viewtopic.php?t=5756', '', '', '0', '1', 378, 3228, 0, 0, 0, 0, '4b3e82e0ed6bd18fc47ea6aa1a04142d', 'FALSE'),
(4215, '8282A59F-154B-4CFF-9533-8428AFDE950A', 'Easy Film Importer', 'Easy to use  film importer for MeediOS home theater application.', '', 'Import', 'None', 'Donationware', 'Alpha', '2012-10-11 16:30:38', '0.7.2', 'Skamagkis Stavros', 'stavrossk@gmail.com', 'enthalpient', '2008-2012 Skamagkis Stavros', '', 'plugins/8282A59F-154B-4CFF-9533-8428AFDE950A/0.7.2/alpha/Easy_Film_Importer_0.7.2_Alpha.mopp', '122936', '', '', '', 7002000000000000, 1, 'For usage instructions, feature requests,\n bug reports or suggestions,\n please use the plugin''s official forum thead:\n\nhttp://www.meedios.com/forum/viewtopic.php?f=65&t=7705', 'Easy Film Importer', 'https://github.com/stavrossk', '', '0.1', '10', '0', '1', 72, 89, 0, 0, 0, 0, 'd2d2ec1e5f0e2cbe50a3c450a46edec5', 'FALSE'),
(4216, 'A2018B54-C56F-408E-BA42-B88F99D7D1FD', 'Madvr_VideoPlayer', 'Video Player using MadVR and LAV directshow filters', '', 'General', 'None', '', 'Alpha', '2012-10-13 04:40:54', '1.002', 'ccrocker', '', 'ccrocker', '', '', 'plugins/A2018B54-C56F-408E-BA42-B88F99D7D1FD/1.002/alpha/Madvr_VideoPlayer_1.002_Alpha.mopp', '246438', '', '', '', 1002000000000000000, 0, 'Video player engine based on WPFMediaKit and using LAV filters\n\n\nWARNING\nIt replaces (if present) WPFMediaKit.dll, DirectShowLib-2005.dll in the assemblies folder\n\nRequirements\n- LAV Filters and Madvr must be installed (http://forum.doom9.org/showthread.php?t=156191)\n- Use WPFMediaKit.dll and DirectShowLib-2005.dll from this distribution. Meedios \ncrashes if other versions of DirectShowLib-2005 are used. Both files should be \nplaced in the assemblies folde. It has a special screen for the Evolution theme. But it doesn''t overwrite any\ntheme screen, uses it''s own\n\n\n\nKnown Issues\n- Buffering and Downloading progress events are not being handled\n- Next and Previous don''t work\n- Resume at the correct spot, but not at the spot shown to the user in the\ndialog box', 'Madvr_VideoPlayer', '', '', '', '', '0', '1', 11, 712, 0, 0, 0, 0, '9df0cc45e0ff0406603f5192e00ee5b5', 'FALSE'),
