(4173, '4C14E85C-AD21-4DF8-836E-66074995D8A9', 'MCE', 'MCE Remote', '', 'Input', 'None', 'Donationware', 'Alpha', '2012-08-26 00:14:01', '1.0', 'reverson1', '..', 'UL By:skypichat', '2010', '', 'plugins/4C14E85C-AD21-4DF8-836E-66074995D8A9/1.0/alpha/MCE_1.0_Alpha.mopp', '11201', '', '', '', 1000000000000000000, 1, '.01 - Original Release\n      .02 - Added support for Windows 7\n            Added logging of unsupported devices\n      .03 - Moved configuration of devices to Devices.xml\n            Logging has been moved to SystemLog.txt\n            Possible settings for unrecognized devices are logged\n            Added Devices.xml\n      .04 - Added support for x64', 'MCE', '..', '', '', '', '0', '1', 157, 157, 0, 0, 0, 0, 'd3b32faa11f437c8e3028da39a27ab18', 'FALSE'),
(4177, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Stable', '2012-08-27 05:45:20', '2.1.4.9', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.1.4.9/stable/DiscID_2.1.4.9_Stable.mopp', '7954823', '', '', 'ReadMe.txt', 2001004009000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.', 'DiscID', '', '', '', '', '0', '1', 285, 71175, 0, 0, 0, 0, 'a1b3ccc68c038219695bbf240e3bb655', 'FALSE'),
