(4194, 'E8FAA3D7-5B76-4419-BA6D-45C29ECA4492', 'MoviesFileImporter', 'This importer searches the files/sub-directories contained in the root folders that you specify and adds an item for each movie file it finds. Depending on \n  the search style that you choose it will use the directory name, or parts of the filename to det', '', 'Import', 'None', 'Donationware', 'Stable', '2012-09-06 23:40:27', '3.0.4', 'artfulfox', 'katie@artfulfox.net', 'artfulfox', 'Â© 2012 artfulfox; Â© 2011 ccrocker, skypichat, dakkar; Â© 2010 flclsd', '', 'plugins/E8FAA3D7-5B76-4419-BA6D-45C29ECA4492/3.0.4/stable/MoviesFileImporter_3.0.4_Stable.mopp', '267748', '', '', '', 3000004000000000000, 1, 'Add the importer to your library, set the folder root paths that you want to search, and run.\n        If you want use your own regex, add your regex file with this name and in this folder :\n        (MeediOS-Root-dir)\\data\\PluginsSettings\\MoviesFileImporter\\CustomRegex.txt.\n        If you have movies in folders created by ripping DVDs or Blu-Ray discs, then choose the ''Search ripped disc folders" option. It is extremely fast. If you have *any* ripped disc folders\n        then I suggest you put them all in the same directory and use a specific instance of the importer with the ripped disk folders setting.\n        If there is a file in the movie directory called "imdb.nfo", the importer will read it and extract the IMDB id.\n\n        If you enable the option to search for supporting files and choose search folderName or search ripped-disc folders search style, then "folder.ext" and "*fanart*.ext" (where ext is a \n        valid image file extension) will be picked up as the image file and fan-art file list.\n        If you cloose search by FileName, then any valid image files that contain the movie name or movie-filename (without extension) will be picked up too for the Image tag. If a valid image\n        file also contains "fanart" in the filename it will be added to the fanart tag (the importer will add as many matching fanart files as it finds to the fanart tag as multiple paths).\n\n        If you choose to enable the debug log, the importer will log progress to a file in the (meediOS Root Dir)\\data\\Logs directory. It creats one log per day so if you run it more than once in a day\n        the log will be appended.\n\n        NOTE: since I have all my movies either as individual files that I renamed to match the posted file name format(s), or as complete ripped disc folders, I have not tested this for the many \n    possible variations of folder naming. Please report your results. And PLEASE consider renaming your movie files/folders to match the more common formats.', 'MoviesFileImporter', 'http://www.meedios.com/forum/viewtopic.php?t=5934', 'http://www.meedios.com/OpenMAIDOS/dl.php?plugin_id=E8FAA3D7-5B76-4419-BA6D-45C29ECA4492', '', '', '0', '1', 611, 4624, 0, 0, 0, 0, 'fb862ed0714755f560da0cbba43a51da', 'FALSE'),
