(4283, 'AB3510BC-D89D-4245-A6A9-7C9FE8C373F6', 'Google Calendar Importer', 'Imports Google Calendar events into the Library.', '', 'Import', 'None', 'Freeware', 'Beta', '2013-01-20 17:14:54', '1.1', 'NeverMind', 'support@meedios.com', 'Nevermind', '', '', 'plugins/AB3510BC-D89D-4245-A6A9-7C9FE8C373F6/1.1/beta/Google_Calendar_Importer_1.1_Beta.mopp', '479650', '', '', '', 1001000000000000000, 1, 'Imports calendar events from google calendars into a Meedio library.\n\nI have provided a screen file that contains a view called "calendar-events". Set the mode of your view of the library to this in Meedio Configuration''s Media Library tab. Add a media module to your menu and set the media library section to your imported calendar library, then set the alternate screen to point at the googlecalendar.screen file.\n\nIf you want images to appear along side each calendar entry then place an image file ( *.jpg,*.gif,*.png ) in this plugins images directory. The screen file looks for any images with the same name as the calendar.\n\nIt''s not very pretty but it does the job. :o)', 'GoogleCalendarImporter', 'http://www.meedio.com/maid', '', '0.1', '', '0', '1', 15, 15, 0, 0, 0, 0, '77d5b56ae406a6d0685e0f9122847132', 'FALSE'),
