(4291, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Stable', '2013-02-09 04:55:30', '2.1.6.4', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.1.6.4/stable/DiscID_2.1.6.4_Stable.mopp', '8295754', '', '', 'ReadMe.txt', 2001006004000000000, 0, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.', 'DiscID', '', '', '', '', '0', '1', 2565, 71175, 0, 0, 0, 0, '6b8b377a9152dca973fe5da9bd8eabdd', 'FALSE'),
(4292, '5FB90B66-6C70-4B46-A4E9-195834A47DF5', 'MeediOS Personal Video Recorder', 'A client for ArgusTV (www.argus-tv.com). Watch and manage recorded TV.', '', 'General', 'None', '', 'Beta', '2013-02-10 16:48:08', '0.6.0', 'Maarten Klaassen (maarten77) & Tim Rigby (Nevermind)', '', 'Nevermind', '', '', 'plugins/5FB90B66-6C70-4B46-A4E9-195834A47DF5/0.6.0/beta/MeediOS_Personal_Video_Recorder_0.6.0_Beta.mopp', '1680563', '', '', '', 6000000000000000, 0, 'Version 0.6.0\nFirst version to support Argus TV server.\nAlso supports the older ForTheRecord TV Server (v.1.7)\nViewing recordings, upcoming recordings and server status should work OK.\nGuide searching and schedule browsing is incomplete/alpha.\nEPG is VERY broken/unusable,', 'MeediOSPVR', '', '', '', '', '0', '1', 15, 511, 0, 0, 0, 0, '722b10305580f459ec84045729b1daa4', 'FALSE'),
(4293, '1B5C2C44-711F-4ABA-8FE3-EDE2CF13A3DD', 'MediaInfoImporter', 'MediaInfoImporter for MeediOS.', '', 'Import', 'None', '', 'Stable', '2013-02-16 21:58:47', '1.122', 'Dakkar', 'paolo.croce@gmail.com', 'ccrocker', '', '', 'plugins/1B5C2C44-711F-4ABA-8FE3-EDE2CF13A3DD/1.122/stable/MediaInfoImporter_1.122_Stable.mopp', '1810753', '', '', '', 1122000000000000000, 1, 'Not yet available.', 'MediaInfoImporter', '', '', '', '', '0', '1', 34591, 57221, 0, 0, 0, 0, '896d90ef1b11b3e53c1d340b79f1f7da', 'FALSE'),
