(4309, 'C9E487C3-8A8D-4194-894F-404D22564773', 'TriggerMee', 'Trigger imports when new files are added', '', 'General', 'None', '', 'Stable', '2013-02-25 12:31:47', '0.90', 'Brian Anderson', 'banderson1311@gmail.com', 'banderson1311', '2010', '', 'plugins/C9E487C3-8A8D-4194-894F-404D22564773/0.90/stable/TriggerMee_0.90_Stable.mopp', '344657', '', '', '', 90000000000000000, 1, 'Wiki page coming soon', 'TriggerMee', 'http://www.meedios.com/forum/viewtopic.php?t=5271', '', '', '', '0', '1', 13944, 26336, 0, 0, 0, 0, '1f2b8efc9ad8b61a61fd4b5622a675a1', 'FALSE'),
(4310, '2A4246AD-376C-448D-A056-D8A226157998', 'DiscID', 'Identify audio, video, and photo discs.  Please read the included documentation.', '', 'General', 'None', '', 'Stable', '2013-02-26 06:09:16', '2.1.6.7', 'ccrocker', '', 'ccrocker', '', '', 'plugins/2A4246AD-376C-448D-A056-D8A226157998/2.1.6.7/stable/DiscID_2.1.6.7_Stable.mopp', '8300395', '', '', 'ReadMe.txt', 2001006007000000000, 1, 'This is a full time general plugin that waits for a disc to be inserted into the drive and then processes it based on your selected options. It will identify a variety of discs. Some options are handled by other programs. You should understand how these programs work. The first time a disc is inserted, the plugin will search your computer for these programs based on your options. If the programs are not found, the disc will eject and a screen will be displayed indicating what to install. \n\nThis plugin does not contain any code that will decrypt or remove copy protection from any disc. None of the programs that this plugin launches will remove any copy protection. The main point of this plugin is to identify discs based on a calculated hash of the original discs contents. Its likely that any alterations to the original disc will not allow it to be identified properly. \n\nIf you select a back up option, you acknowledge by using this plugin that you are familiar with the relevant laws of your country.  You acknowledge that this plugin does not remove copy protection and cannot back up commercial discs.', 'DiscID', '', '', '', '', '0', '1', 9937, 71175, 0, 0, 0, 0, '3f3beaca22c3ae8ba31f70502ab1b9a5', 'FALSE'),
