(4316, '5FB90B66-6C70-4B46-A4E9-195834A47DF5', 'MeediOS Personal Video Recorder', 'A client for ArgusTV (www.argus-tv.com). Watch and manage recorded TV.', '', 'General', 'None', '', 'Beta', '2013-03-03 15:30:13', '0.6.3', 'Maarten Klaassen (maarten77) & Tim Rigby (Nevermind)', '', 'Nevermind', '', '', 'plugins/5FB90B66-6C70-4B46-A4E9-195834A47DF5/0.6.3/beta/MeediOS_Personal_Video_Recorder_0.6.3_Beta.mopp', '1770431', '', '', '', 6003000000000000, 1, 'Version 0.6.3. Add support for resume when using MadVR player. Added popup menu to delete, activate/deactivate schedules.\n\nVersion 0.6.2 Bug fix for creating view steps.\nVersion 0.6.1 Recordings screen now works in all modes. Title, Category, Channel etc. Selected mode is remembered. Status screen revised to show active recordings details. Fixed crashes when used with .Net 4.5 version of Meedios. Various other small tweaks to UI.\n\nVersion 0.6.0\nFirst version to support Argus TV server.\nAlso supports the older ForTheRecord TV Server (v.1.7)\nViewing recordings, upcoming recordings and server status should work OK.\nGuide searching and schedule browsing is incomplete/alpha.\nEPG is VERY broken/unusable,', 'MeediOSPVR', '', '', '', '', '0', '1', 4, 511, 0, 0, 0, 0, 'fd2adba6299129eb24f45c99e80ebe61', 'FALSE');
